INSERT INTO `artist` VALUES (1,'Pierre-Auguste','Renoir',1,1841,1919,'Leading painter in the development of the Impressionist genre'),(3,'Rene','Magritte',6,1898,1967,'Surrealist painter, known for his series of The Treachery of Images'),(5,'Leonardo','da Vinci',4,1452,1519,'Polymath active during the High Renaissance'),(6,'Pablo','Picasso',3,1881,1973,'Spanish painter, sculptor, printmaker, ceramicist and theatre designer who spent most of his adult life in France.'),(7,'Vincent','van Gogh',11,1853,1890,'Dutch Post-Impressionist painter who posthumously became one of the most famous and influential figures in Western art history.'),(8,'Raphael','Sanzio',4,1483,1520,'Italian painter and architect of the High Renaissance. His work is admired for its clarity of form, ease of composition, and visual achievement of the Neoplatonic ideal of human grandeur.'),(9,'Salvador','Dalí',3,1904,1989,'Dali was a Spanish surrealist artist renowned for his technical skill, precise draftsmanship, and the striking and bizarre images in his work. Born in Figueres, Catalonia, Spain, Dalí received his formal education in fine arts in Madrid. Influenced by Impressionism and the Renaissance masters from a young age he became increasingly attracted to Cubism and avant-garde movements.'),(10,'Claude','Monet',1,1840,1926,'Monet was a French painter and founder of impressionist painting who is seen as a key precursor to modernism, especially in his attempts to paint nature as he perceived it.'),(11,'Sandro','Botticelli',4,1445,1510,'Alessandro di Mariano di Vanni Filipepi, known as Sandro Botticelli, was an Italian painter of the Early Renaissance. Botticelli\'s posthumous reputation suffered until the late 19th century, when he was rediscovered by the Pre-Raphaelites who stimulated a reappraisal of his work.'),(12,'Wassily','Kandinsky',7,1866,1944,'He was a painter and art theorist. Kandinsky is generally credited as one of the pioneers of abstraction in western art, possibly after Hilma af Klint. Born in Moscow, he spent his childhood in Odessa, where he graduated at Grekov Odessa Art school.');
/*!40000 ALTER TABLE `artist` ENABLE KEYS */;
