INSERT INTO `genre` VALUES (1,'Renaissance','Subjects grew from mostly biblical scenes to include portraits, episodes from Classical religion, and events from contemporary life.'),(2,'Realism','Represents the attempt to represent subject matter truthfully, without artificiality and avoiding speculative fiction and supernatural elements.'),(3,'Impressionism','It is a 19th-century art movement characterized by relatively small, thin, yet visible brush strokes, open composition, emphasis on accurate depiction of light in its changing qualities (often accentuating the effects of the passage of time), ordinary subject matter, unusual visual angles, and inclusion of movement as a crucial element of human perception and experience.'),(4,'Abstract Art','It consists of art that does not attempt to represent an accurate depiction of a visual reality but instead use shapes, colours, forms and gestural marks to achieve its effect.'),(5,'Expressionism','Artistic style in which the artist seeks to depict not objective reality but rather the subjective emotions and responses that objects and events arouse within a person. The artist accomplishes this aim through distortion, exaggeration, primitivism, and fantasy.'),(6,'Romanticism','Romanticism was characterized by its emphasis on emotion and individualism, idealization of nature, suspicion of science and industrialization, and glorification of the past with a strong preference for the medieval rather than the classical.'),(7,'Surrealism','Surrealism aims to revolutionise human experience. It balances a rational vision of life with one that asserts the power of the unconscious and dreams. The movement\'s artists find magic and strange beauty in the unexpected and the uncanny, the disregarded and the unconventional.'),(8,'Cubism','Cubism is an artistic movement, created by Pablo Picasso and Georges Braque, which employs geometric shapes in depictions of human and other forms. Over time, the geometric touches grew so intense that they sometimes overtook the represented forms, creating a more pure level of visual abstraction.'),(9,'Simbolism','Symbolism was a late 19th-century art movement of French, Russian and Belgian origin in poetry and other arts seeking to represent absolute truths symbolically through language and metaphorical images, mainly as a reaction against naturalism and realism.'),(10,'Pop Art','Pop art is an art movement that emerged in the United Kingdom and the United States during the mid- to late-1950s.[1][2] The movement presented a challenge to traditions of fine art by including imagery from popular and mass culture, such as advertising, comic books and mundane mass-produced objects. One of its aims is to use images of popular (as opposed to elitist) culture in art, emphasizing the banal or kitschy elements of any culture, most often through the use of irony.');
/*!40000 ALTER TABLE `genre` ENABLE KEYS */;
UNLOCK TABLES;

